import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('resPrepend', () => {
    test('ok', async () => {
        const r1 = await request({
            url: 'https://resprepend.resbody.resappend.test.whistlejs.com/?resBody=',
            method: 'post'
        });
        expect(r1.data).toBe('prependbodyappend');
        const r2 = await request('http://resprepend.resbody.resappend.test.whistlejs.com/?resBody=');
        expect(r2.data).toBe('prependbodyappend');
    });
});
